    function getWinner()
        external
        isStatus(WorkflowStatus.VotesTallied)
    {
        require(winningProposalId > 0, "Winner not found");
        emit Winner( _proposals[winningProposalId].description, _proposals[winningProposalId].voteCount);
    }
